function getRandomNumber(min = 0, max = 100) {
    return Math.min(Math.floor(min + Math.random() * (max - min)), max);
}

const userAgent = userAgentList[getRandomNumber(0, userAgentList.length - 1)];

async function getUserInfo(cookie) {
    const headers = {
        "Cookie": cookie,
        "user-agent": userAgent
    };
    const requestOptions = {
        "url": "https://restapi.ele.me/eus/v5/user_detail",
        "headers": headers
    };
    return new Promise((resolve, reject) => {
        request(requestOptions, (error, response, body) => {
            if (!error && response.statusCode === 200) {
                resolve(JSON.parse(body));
            } else {
                reject(error || new Error('Failed to fetch user info'));
            }
        });
    });
}

async function main() {
    for (const item of elmck) {
        token = item.token;
        userId = item.id;
        try {
            const userInfo = await getUserInfo(token);
            if (userInfo) {
                const phone = `${userInfo.mobile}`
                const username = `${userInfo.username}`
                const push_content = `${name}|${phone}|${username}`
                saveResultToFile("success", push_content)
                console.log(`✅${name}|CK正常|${username}|${phone}`)
            } else {
                saveResultToFile("error", name)
                console.error('❌饿了么账号CK已失效，请重新获取！');
            }
        } catch (error) {
            console.error('饿了么账号CK已失效，请重新获取！');
            saveResultToFile("error", name)
        }

        DD = RT(5000, 10000)
        console.log(`等待${DD}s`);
        await $.wait(DD)
    }
}

!(async () => {
    await main();
})().catch((e) => { $.log(e) }).finally(() => { $.done({}); });


const fs = require('fs');
const todayDate = new Date().toISOString().split('T')[0].replace(/-/g, '');
function saveResultToFile(status, name) {
    let result;
    if (status === "success") {
        result = `✅【${name}】 | CK正常`;
    } else if (status === "error") {
        result = `❌【${name}】 | CK已失效`;
    }

    const fileName = `script_results_${todayDate}.txt`;

    try {
        fs.appendFileSync(fileName, `${result}\n`, 'utf8');
    } catch (err) {
        console.error(`保存结果到文件时出现异常：${err.message}`);
    }
}

// 随机整数生成
function RT(X, Y) {
    let rt;
    do {
        rt = Math.round(Math.random() * Y);
    } while (rt < X);
    console.log(`随机等待${rt}ms`);
    return rt;
}


